description:
Add a setter function called `setAuctionDuration` to the `NounsAuctionHouseV1.sol` contract. This function enables the update of the auction duration through a governance proposal. An event, `AuctionDurationUpdated`, is emitted whenever the duration is changed via an approved proposal.

```solidity
    // Event emitted when the auction duration is updated
    event AuctionDurationUpdated(uint256 newDuration);

    /**
     * @notice Set a new auction duration.
     * @param _newDuration The new duration for the auction.
     * @dev Only callable by the owner.
     */
    function setAuctionDuration(uint256 _newDuration) external onlyOwner {
        duration = _newDuration;
        emit AuctionDurationUpdated(_newDuration);
    }
```
